<!DOCTYPE html>
<html>

<head>
  <meta charset="utf-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
  <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">
  <meta http-equiv="pragma" content="no-cache" />
  <meta http-equiv="cache-control" content="no-cache, no-store, must-revalidate" />
  <meta http-equiv="expires" content="0" />
  <link rel="icon" href="<%= BASE_URL %>favicon.ico">
  <title id="title">
    <%= webpackConfig.name %>
  </title>
  <script src="./config.js"></script>
</head>

<body>
  <noscript>
    <strong>We're sorry but <%= webpackConfig.name %> doesn't work properly without JavaScript enabled. Please enable it
        to continue.</strong>
  </noscript>
  <div id="app"></div>
  <!-- built files will be auto injected -->
  <script type="text/javascript" src="./wewin/labelimage/static/jquery.min.js"></script>
  <script type="text/javascript" src="./wewin/labelimage/static/all.jquery.js"></script>
  <script type="text/javascript" src="./wewin/labelimage/static/WewinPrintService.js"></script>
  <script type="text/javascript" src="./wewin/code.js"></script>

  <!--hipritn JS 部分 -->
  <script src="./hiprint/polyfill.min.js"></script>
  <script src="./hiprint/hiprint.bundle.js"></script>
  <script src="./hiprint/jquery.hiwprint.js"></script>
</body>

</html>
